import React from 'react';
import { createStackNavigator } from '@react-navigation/stack';
import { View, TouchableOpacity, StyleSheet } from 'react-native';
import { FontAwesomeIcon } from '@fortawesome/react-native-fontawesome';
import { faHouse, faCamera, faImage, faBars, faQuestion } from '@fortawesome/free-solid-svg-icons';



const Stack = createStackNavigator();

function CustomFooter({navigation}) {
  return (
    <View style={styles.footer}>
      <TouchableOpacity style={styles.icon} onPress={() => navigation.navigate('Home')}>
        <FontAwesomeIcon icon={faHouse} size={32} />
      </TouchableOpacity>
      <TouchableOpacity style={styles.icon} onPress={() => navigation.navigate('Login')}>
        <FontAwesomeIcon icon={faCamera} size={32} />
      </TouchableOpacity>
      <TouchableOpacity style={styles.icon} onPress={() => navigation.navigate('SignUp')}>
        <FontAwesomeIcon icon={faImage} size={32} />
      </TouchableOpacity>
      <TouchableOpacity style={styles.icon} onPress={() => navigation.navigate('UserHome')}>
        <FontAwesomeIcon icon={faBars} size={32} />
      </TouchableOpacity>
      <TouchableOpacity style={styles.icon} onPress={() => navigation.navigate('RegistrationSuccess')}>
        <FontAwesomeIcon icon={faQuestion} size={32} />
      </TouchableOpacity>
    </View>
  );
}

export function RootNavigator() {
  return (
    <>
      <Stack.Navigator>
        {/* ... Ihre Stack.Screens ... */}
        {/* Beispiele für Stack.Screens (fügen Sie diese entsprechend Ihren Bedürfnissen hinzu) */}
        <Stack.Screen name="Home" component={Home} />
        <Stack.Screen name="Login" component={Login} />
        <Stack.Screen name="SignUp" component={SignUp} />
        <Stack.Screen name="UserHome" component={UserHome} />
        <Stack.Screen name="RegistrationSuccess" component={RegistrationSuccess} />
      </Stack.Navigator>
      <CustomFooter />
    </>
  );
}

const styles = StyleSheet.create({
  footer: {
    flexDirection: 'row',
    justifyContent: 'space-around',
    backgroundColor: 'rgba(239, 239, 240, 0.884)',
    padding: 10,
    position: 'absolute',
    bottom: 0,
    left: 0,
    right: 0,
  },
  icon: {
    padding: 10,
  },
});
